import{Hash,Delim}from"../../tokenizer/index.js";export const name="IdSelector";export const structure={name:String};export function parse(){const t=this.tokenStart;return this.eat(Hash),{type:"IdSelector",loc:this.getLocation(t,this.tokenStart),name:this.substrToCursor(t+1)}}export function generate(t){this.token(Delim,"#"+t.name)}